            return EffectShaderFactory(
                stream: new BinaryMemoryReadStream(slice),
                package: package,
                recordTypeConverter: recordTypeConverter);
        }

        #region To String

        public override void ToString(
            FileGeneration fg,
            string? name = null)
        {
            EffectShaderMixIn.ToString(
                item: this,
                name: name);
        }

        #endregion

    }

}
